import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Syllabus = () => {
  const [syllabusList, setSyllabusList] = useState([]);
  const [showForm, setShowForm] = useState(false);
  const [newSyllabus, setNewSyllabus] = useState({
    university: '',
    course: '',
    semester: '',
    subject: '',
    pdf: null
  });

  useEffect(() => {
    axios.get('http://localhost:5000/api/syllabus')
      .then(res => setSyllabusList(res.data))
      .catch(err => console.error('Error fetching syllabus:', err));
  }, []);

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setNewSyllabus({
      ...newSyllabus,
      [name]: files ? files[0] : value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData();
    for (let key in newSyllabus) {
      formData.append(key, newSyllabus[key]);
    }

    try {
      const res = await axios.post('http://localhost:5000/api/syllabus', formData);
      setSyllabusList([...syllabusList, res.data]);
      setNewSyllabus({ university: '', course: '', semester: '', subject: '', pdf: null });
      setShowForm(false);
    } catch (err) {
      console.error('Upload error:', err);
      alert('Failed to upload syllabus.');
    }
  };

  return (
    <div className="p-6 bg-white rounded shadow">
      <h2 className="text-2xl font-bold mb-4">Manage Syllabus</h2>

      <button
        onClick={() => setShowForm(!showForm)}
        className="mb-4 bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
      >
        {showForm ? 'Cancel' : 'Add Syllabus'}
      </button>

      {showForm && (
        <form onSubmit={handleSubmit} className="mb-6 bg-gray-100 p-4 rounded shadow space-y-3">
          <input
            type="text"
            name="university"
            placeholder="University"
            value={newSyllabus.university}
            onChange={handleChange}
            className="w-full border px-3 py-2 rounded"
            required
          />
          <input
            type="text"
            name="course"
            placeholder="Course"
            value={newSyllabus.course}
            onChange={handleChange}
            className="w-full border px-3 py-2 rounded"
            required
          />
          <input
            type="text"
            name="semester"
            placeholder="Semester"
            value={newSyllabus.semester}
            onChange={handleChange}
            className="w-full border px-3 py-2 rounded"
            required
          />
          <input
            type="text"
            name="subject"
            placeholder="Subject"
            value={newSyllabus.subject}
            onChange={handleChange}
            className="w-full border px-3 py-2 rounded"
            required
          />
          <div>
            <label className="block mb-1 font-medium">Upload PDF</label>
            <label className="bg-blue-600 text-white px-4 py-2 rounded cursor-pointer hover:bg-blue-700 inline-block">
              Choose File
              <input
                type="file"
                name="pdf"
                accept="application/pdf"
                onChange={handleChange}
                className="hidden"
                required
              />
            </label>
            {newSyllabus.pdf && <span className="ml-2 text-sm text-gray-700">{newSyllabus.pdf.name}</span>}
          </div>
          <button
            type="submit"
            className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700"
          >
            Submit
          </button>
        </form>
      )}

      <div className="space-y-4">
        {syllabusList.map((item, index) => (
          <div key={index} className="border p-4 rounded shadow-sm">
            <h3 className="text-lg font-semibold text-blue-700">{item.subject} ({item.semester})</h3>
            <p className="text-sm text-gray-600">{item.course} - {item.university}</p>
            <a
              href={`http://localhost:5000/uploads/${item.pdf}`}
              target="_blank"
              rel="noopener noreferrer"
              className="text-blue-500 text-sm hover:underline"
            >
              View PDF
            </a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Syllabus;
